import React from 'react';
import Carousel from './components/Carousel';
import CarouselItem from './components/CarouselItem';
import './App.css';

function App() {
  function prevSlide(e){
    e.preventDefault();

  }
  function nextSlide(e){
    e.preventDefault();

  }
  return (
    <Carousel>
      <CarouselItem />
    </Carousel>
  );
}

export default App;
